let posts = [
	{ id: 1, message: 'Hi, how are you?', likesCount: 5 },
	{ id: 2, message: 'It\'s my first post', likesCount: 12 }
]

ReactDOM.render(
	<React.StrictMode>
		<App posts={posts} dialogs={dialogs} messages={messages} />
